get_value(key,value )
{
  let wds_value;
  var re = /Time/;
  var re1 = /Date/;
 // let wds_pump=
  //console.log(wds_pump)
  if(key.search(re) != -1)
  {
    // const now = new Date(value);
    // console.log(this.datepipe.transform(value, 'HH:mm:SS'))
    // const newdate=new Date(now.getTime());; 
    //console.log(formatDate(value_expression, format, timezone, locale ))
    wds_value=value
  }
  else{
    if(key.search(re1) != -1)
    {
      wds_value=value;
    }
    else{
    if(value !=null)
    {
      if(value<0){
        wds_value=0.00;
      }else{
      wds_value=value.toFixed(2);
    }      
        //wds_value=value.toFixed(2);      
    }
    else{
      wds_value=0;
    }
  }
  }
  return wds_value
}

